	function clickOnHighlightedArea(e, aoi, framePos) {
		if (!GmCXt.isEmpty(aoi)) {
			var left = e.clientX;
			var top = e.clientY;

			if (!GmCXt.isEmpty(framePos)) {
				left += framePos.x;
				top += framePos.y;
			}

			if ((left > aoi.left && left < (aoi.left + aoi.width)) &&
				(top > aoi.top && top < (aoi.top + aoi.height))) {
				return true;
			}
		}
		return false;
	}

